@superweh Dear Jean, 
On #EUbudget as well as on #FutureofEurope, citizens had the opportunity to express their views right from the start of our work by providing answers to the open public consultations https://t.co/8oujersWWQ 
The consultations continue, watch for #EUHaveYourSay !

We will not accept that in some parts of Europe, people are sold food of  lower quality, despite identical packaging.
Our researchers have worked with experts to develop a harmonised testing methodology to identify #DualFoodQuality → https://t.co/M1YGYXbDHL
